import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Routes, Route, useParams } from 'react-router-dom';
import Home from './pages/home/Home';
import ThingsToDo from './pages/Things_to_do/ThingsToDo';
import Hotel from './pages/hotels/Hotel';
import Guiders from './pages/guiders/Guiders';
import RentalCars from './pages/rental_cars/RentalCars';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Admin from './Dashboards/admin/Admin';
import Login from './pages/login/Login';
import Signup from './pages/signup/Signup';
import UserDashboard from './Dashboards/userdashboard/UserD';

// Wrapper to pass userId param to UserDashboard
function UserDashboardWrapper() {
  const { userId } = useParams();
  return <UserDashboard userId={userId} />;
}

function App() {
  return (
    <div>
    <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/things-to-do" element={<ThingsToDo />} />
          <Route path="/hotels" element={<Hotel />} /> 
          <Route path="/guiders" element={<Guiders />} />
          <Route path="/rental-cars" element={<RentalCars />} />
          <Route path="/admin" element={<Admin />} /> 
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/user-dashboard/:userId" element={<UserDashboardWrapper />} />
        </Routes>
        <Footer/>
      </Router>
    </div>
  );
}

export default App;
